import React, { useState } from "react";
import axios from "axios";
import toast, { Toaster } from 'react-hot-toast';

// InputBox Component (should be defined or imported)
const InputBox = ({ type, placeholder, name, value, onChange }) => (
    <input
        type={type}
        placeholder={placeholder}
        name={name}
        value={value}
        onChange={onChange}
        className="w-full rounded-md border border-gray-300 px-4 py-2 text-base text-body-color outline-none transition focus:border-primary focus-visible:shadow-none dark:border-dark-5 dark:bg-dark-3 dark:text-white"
        required
    />
);

const SignUp = () => {
    const [formData, setFormData] = useState({
        name: "",
        email: "",
        number: "",
        password: "",
        address: ""
    });

    const handleChanges = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleFormSubmit = async (e) => {
        e.preventDefault();

        try {
            const response = await axios.post('http://localhost:3001/api/register', formData);
            toast.success(`You have been registered successfully!`);
            console.log(response.data);
        } catch (err) {
            toast.error(`Registration failed. Please try again later.`);
            console.error("Error:", err);
        }
    };

    return (
        <section className="bg-gray-1 py-20 dark:bg-dark lg:py-[120px]">
            <Toaster position="top-right" reverseOrder={false} />
            <div className="container mx-auto">
                <div className="-mx-4 flex flex-wrap">
                    <div className="w-full px-4">
                        <div className="relative mx-auto max-w-[52%] overflow-hidden rounded-lg bg-white px-10 py-16 text-center dark:bg-dark-2 sm:px-12 md:px-[60px]">
                            <div className="mb-10 text-center md:mb-16">
                                <a href="/#" className="mx-auto inline-block max-w-[160px]">
                                    <img
                                        src="https://cdn.tailgrids.com/2.0/image/assets/images/logo/logo-primary.svg"
                                        alt="logo"
                                    />
                                </a>
                            </div>
                            <form method="POST" onSubmit={handleFormSubmit}>
                                <div className="flex gap-4 w-full">
                                    <InputBox type="text" placeholder="Name" name="name" value={formData.name} onChange={handleChanges} />
                                    <InputBox type="number" placeholder="Number" name="number" value={formData.number} onChange={handleChanges} />
                                </div>
                                <InputBox type="text" placeholder="Address" name="address" value={formData.address} onChange={handleChanges} />
                                <InputBox type="email" placeholder="Email" name="email" value={formData.email} onChange={handleChanges} />
                                <InputBox type="password" placeholder="Password" name="password" value={formData.password} onChange={handleChanges} />
                                <div className="mb-10">
                                    <input
                                        type="submit"
                                        value="Sign Up"
                                        className="w-full cursor-pointer rounded-md border border-primary bg-primary px-5 py-3 text-base font-medium text-white transition hover:bg-opacity-90 bg-[#090e34]"
                                    />
                                </div>
                            </form>
                            <p className="mb-6 text-base text-secondary-color dark:text-dark-7">Connect With</p>
                            <ul className="-mx-2 mb-12 flex justify-between">
                                {/* Social Media Links Here */}
                            </ul>
                            <a href="/#" className="mb-2 inline-block text-base text-dark hover:text-primary hover:underline dark:text-black">
                                Forget Password?
                            </a>
                            <p className="text-base text-body-color dark:text-dark-6">
                                <span className="pr-0.5">Already Have An Account?</span>
                                <a href="/#" className="text-primary hover:underline">Sign Up</a>
                            </p>
                        </div>
                    </div>
                </div>
            </div>
        </section>
    );
};

export default SignUp;
